    debugger
  const [coins, setCoins] = useState([]);

  useEffect(() => {
    return request().then((res) => {
        setCoins(res.data)
    });
  }, [0]);

  console.log(coins)

  const CoinBlockElem = coins.map(el => <CoinBlock name={el.name}/>)
  return <div>
      {CoinBlockElem}
  </div>;
};

export default CoinBlockContainer;
